import {FaTimes} from 'react-icons/fa'
import {BiPencil} from "react-icons/all";

function Task({task}) {
    return (
      <div className='task alert'>
          {task.beschreibung}
          <div className='icons'>
            <BiPencil/>
            <FaTimes/>
          </div>
      </div>
    );
}

export default Task;
